import React, { useState } from "react";
import Nav from "react-bootstrap/Nav";
import NavBar from "react-bootstrap/Navbar";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";

function Navigation() {
  const [currentPage, setCurrentPage] = useState("/");

  console.log(currentPage)
  return (
    <NavBar expand="lg">
      <NavBar.Toggle aria-controls="basic-navbar-nav" />
      <NavBar.Collapse id="navbarSupportedContent">
        <Nav className="ml-auto" activeKey={currentPage} onSelect={(selectedPage) => alert(`selected ${selectedPage}`)}>
          <Nav.Link href="/">INICIO</Nav.Link>
          <Nav.Link href="/Proyectos" eventKey="/Proyectos"> PROYECTOS </Nav.Link>
          <Nav.Link href="/Eventos" eventKey="/Eventos"> EVENTOS </Nav.Link>
          <Nav.Link href="/NuestraGente" eventKey="/NuestraGente"> NUESTRA GENTE </Nav.Link>
          <Nav.Link href="/SobreNosotros" eventKey="/SobreNosotros">SOBRE NOSOTROS</Nav.Link>
          <Nav.Link href="/Consultas" eventKey="/Consultas">CONSULTAS</Nav.Link>
        </Nav>
      </NavBar.Collapse>
    </NavBar>
  );
}
export default Navigation;
